import { Card } from 'antd'
import React from 'react'
import { useSelector } from 'react-redux'


function myRecord() {
    const {me}=useSelector((state)=>state.user)
  return (

    <div>
        {me.posts.map((v)=>(
            <Card
            hoverable
            >
                {v.title}
            </Card>
        ))}
    </div>
  )
}

export default myRecord
